  const [languagePreset, setLanguagePreset] = useState(null);

  useEffect(() => {
    const language = localStorage.getItem('preferredLanguage') || 'JS';
    setLanguagePreset(language);
  }, [])

  useEffect(() => {
    localStorage.setItem('preferredLanguage', languagePreset)
